import React, { useState } from 'react'
import ReactDOM from 'react-dom'

const Form = () => {
    const initialState = [
        {
            task: 'サンプルテキスト１',
            isCompleted: false
        },
        {
            task: 'サンプルテキスト２',
            isCompleted: false
        },
        {
            task: 'サンプルテキスト３',
            isCompleted: false
        },     
    ]

    const [todos, setTodo] = useState(initialState);

    return (
        <div>
            <h1>Todo App</h1>
            <ul>
                { todos.map((todo, index) => (
                <li key={ index }>{ todo.task }</li>
                ))}
            </ul>
        </div>
  );
}

export default Form
